import React, {useState} from 'react';
import { TextField, Button, Stack } from '@mui/material';
import { Link } from "react-router-dom"

import { Grid, Paper, Typography } from '@mui/material';
import WorkIcon from '@mui/icons-material/Work';
import SchoolIcon from '@mui/icons-material/School';
import Timeline from '@mui/lab/Timeline';
import TimelineItem, { timelineItemClasses } from '@mui/lab/TimelineItem';
import TimelineSeparator from '@mui/lab/TimelineSeparator';
import TimelineConnector from '@mui/lab/TimelineConnector';
import TimelineContent from '@mui/lab/TimelineContent';
import TimelineDot from '@mui/lab/TimelineDot';
import { ThemeProvider } from '@mui/material/styles';

import './Resume.css';
import '../../App.css';
import '../../components/Timeline/Timeline.css';
import {resumeData, about_me} from '../../utils/resumeData';
import CustomButton from '../../components/Button/Button';
import { theme } from '../../themes/theme';

export default function Resume() {

    let pathName = window.location.pathname;

    const [name, setName] = useState('')
    const [email, setEmail] = useState('')
    const [message, setMessage] = useState('')
 
    function handleSubmit(event) {
        event.preventDefault();
        console.log(name, email, message);
        console.log(pathName);
    }

    return(
        <>
            {/* About Me */}
            <Grid container className='section pb_45' style={{ backgroundColor: pathName="/resume" ? "block" : "none" }}>
                <Grid item className='section_title mb_20'>
                    <span></span>
                    <h6 className='section_title_text'>About Me</h6>
                </Grid>
                <Grid item xs={12}>
                    {about_me.map((element) => (
                        <Typography variant='body2' className='about_me_text'>
                            <TimelineDot variant='outlined' className='timeline_dot' />
                            {element}
                        </Typography>
                    ))}
                </Grid>
            </Grid>

            {/* Education and Experience */}
            <Grid container className='section pb_45' style={{ display: pathName="/" ? "block" : "none" }}>
                <Grid item className='section_title mb_20'>
                    <span></span>
                    <h6 className='section_title_text'>Resume</h6>
                </Grid>
                {/* <Grid container item xs={12}> */}
                    {/* Experience */}
                    <Grid container item xs={12}>
                        {/* <BasicTimeline title="Experience" icon={<WorkIcon />}>
                            {resumeData.experiences.map(experience => (
                                <CustomTimelineItem className='about_me_text'
                                    title={experience.title}
                                    text={experience.description} />
                            ))}
                        </BasicTimeline> */}
                        <Timeline className='timeline'
                            sx={{
                                [`& .${timelineItemClasses.root}:before`]: {
                                flex: 0,
                                padding: 0,
                                },
                            }}
                            >
                            <TimelineItem>
                                <TimelineSeparator>
                                    <TimelineDot className='timeline_dot_header'>
                                        <WorkIcon />
                                    </TimelineDot>
                                <TimelineConnector className='connector_height' />
                                </TimelineSeparator>
                                <TimelineContent>
                                    <Typography variant='h6' className='timeline_header'>
                                        Experience
                                    </Typography>
                                </TimelineContent>
                            </TimelineItem>
                            {resumeData.experiences.map(experience => (
                                <TimelineItem className='timeline_item'>
                                    <TimelineSeparator>
                                        <TimelineDot variant='outlined' className='timeline_dot' />
                                        <TimelineConnector />
                                    </TimelineSeparator>
                                    
                                        <TimelineContent>
                                            <Typography>{experience.title}</Typography>
                                            <Typography variant='body2'>{experience.institute}</Typography>
                                            <Typography className='experience_time'>{experience.time}</Typography>
                                            <Typography className='experience_text'>{experience.description}</Typography>
                                        </TimelineContent>

                                </TimelineItem>
                            ))}
                        </Timeline>
                    </Grid>

                    {/* Education */}
                    <Grid container item xs={12}>
                        <Timeline className='timeline'
                            sx={{
                                [`& .${timelineItemClasses.root}:before`]: {
                                flex: 0,
                                padding: 0,
                                },
                            }}
                            >
                            <TimelineItem>
                                <TimelineSeparator>
                                    <TimelineDot className='timeline_dot_header'>
                                        <SchoolIcon />
                                    </TimelineDot>
                                <TimelineConnector className='connector_height' />
                                </TimelineSeparator>
                                <TimelineContent>
                                    <Typography variant='h6' className='timeline_header'>
                                        Education
                                    </Typography>
                                </TimelineContent>
                            </TimelineItem>
                            {resumeData.education.map(education => (
                                <TimelineItem className='timeline_item'>
                                    <TimelineSeparator>
                                        <TimelineDot variant='outlined' className='timeline_dot' />
                                        <TimelineConnector />
                                    </TimelineSeparator>
                                    
                                        <TimelineContent>
                                            <Typography>{education.institute}</Typography>
                                            <Typography variant='body2'>{education.degree}</Typography>
                                            <Typography className='experience_text'>{education.program}</Typography>
                                            <Typography className='experience_time'>{education.time}</Typography>
                                        </TimelineContent>

                                </TimelineItem>
                            ))}
                        </Timeline>
                    </Grid>
                {/* </Grid> */}
            </Grid>

            {/* Services */}
            <Grid container className='section'>

            </Grid>

            {/* Skills */}
            <Grid container className='section pb_45'>
                <Grid item className='section_title mb_20'>
                    <span></span>
                    <h6 className='section_title_text'>Skills</h6>
                </Grid>
                <Grid container>
                    <Grid item xs={12}>
                        <Grid container justify="space-between" spacing={3}>
                            {resumeData.skills.map((skill) => (
                                <Grid item xs={12} sm={6} md={3}>
                                    <Paper elevation={0} className='skill'>
                                        <Typography variant='h6' className='skill_title'>
                                            {skill.title}
                                        </Typography>
                                        {skill.description.map((element) => (
                                            <Typography variant='body2' className='skill_description'>
                                                <TimelineDot variant='outlined' className='timeline_dot' />
                                                {element}
                                            </Typography>
                                        ))}
                                    </Paper>
                                </Grid>
                            ))}
                        </Grid>
                    </Grid>
                </Grid>
            </Grid>

            {/* Contact */}
            <Grid container className='section pb_45'>
                <Grid item className='section_title mb_20'>
                    <span></span>
                    <h6 className='section_title_text'>Contact Me</h6>
                </Grid>
                <Grid item xs={12}>
                    <ThemeProvider theme={theme}>
                        <React.Fragment>
                            <form onSubmit={handleSubmit} action={<Link to="/" />}>
                                {/* <Stack spacing={2} direction="row" sx={{marginBottom: 4}}> */}
                                    <TextField
                                        type="text"
                                        variant='outlined'
                                        label="Name"
                                        onChange={e => setName(e.target.value)}
                                        value={name}
                                        fullWidth
                                        required
                                        sx={{mb: 4}}
                                    />
                                {/* </Stack> */}
                                <TextField
                                    type="email"
                                    variant='outlined'
                                    label="Email"
                                    onChange={e => setEmail(e.target.value)}
                                    value={email}
                                    fullWidth
                                    required
                                    sx={{mb: 4}}
                                />
                                <TextField
                                    type="text"
                                    variant='outlined'
                                    label="Message"
                                    onChange={e => setMessage(e.target.value)}
                                    value={message}
                                    fullWidth
                                    required
                                    multiline
                                    rows={5}
                                    sx={{mb: 4}}
                                />
                                <div onClick={handleSubmit} type="submit"><CustomButton text={"Submit"} /></div>
                            </form>
                        </React.Fragment>
                    </ThemeProvider>
                </Grid>
            </Grid>
        </>
    );

}
